import React from 'react'
import Axios from 'axios';
class Index extends React.Component{
    constructor(){
        super();
        this.state={redirect:""}
        Axios.get('http://localhsot:3002/onload',{withCredentials:true}).then(res=>{
            this.setState({redirect:res.data})
        })
    }
    render(){
        return(
        <div>
            {this.state.redirect}
        </div>
        )
    }
}
export default Index;
